    public class DAO
    {
        private string type;
        protected string strValue;
        protected object objValue;

        public DAO(string type)
            : this(type, null)
        {
        }

        public DAO(object value)
            : this(value.GetType().Name, value)
        {

        }

        public DAO(string type, object value)
        {

            this.type = type;

            if (type == BasicType.String.ToString())
            {
                if (value.GetType().Name == BasicType.String.ToString())
                {
                    this.strValue = value as string;
                    this.objValue = value as string;
                }
                else
                {
                    throw new Exception("value isn't string type!");
                }
            }
            else
            {
                if (value.GetType().Name == BasicType.String.ToString())
                {
                    this.strValue = value as string;
                    this.objValue = Str2ObjOfAll(type, value as string);
                }
                else
                {
                    this.strValue = Obj2StrOfAll(type, value);
                    this.objValue = value;
                }
            }

        }

        private string oldStringType = null;
        private BasicType oldBasicType;

        protected TYPE Convert<TYPE>(string value)
        {
            object ret = null;

            string type = typeof(TYPE).Name;

            if (type != oldStringType)
            {
                if (!Util.IsBasicType(type))
                {
                    throw new Exception("not basic type!");
                }

                this.oldStringType = type;

                this.oldBasicType = (BasicType)Enum.Parse(typeof(BasicType), type);
            }

            switch (this.oldBasicType)
            {
                case BasicType.String:
                    ret = value;
                    break;
                case BasicType.Boolean:
                    ret = Boolean.Parse(value);
                    break;
                case BasicType.SByte:
                    ret = SByte.Parse(value);
                    break;
                case BasicType.Byte:
                    ret = Byte.Parse(value);
                    break;
                case BasicType.Char:
                    ret = Char.Parse(value);
                    break;
                case BasicType.Int16:
                    ret = Int16.Parse(value);
                    break;
                case BasicType.UInt16:
                    ret = UInt16.Parse(value);
                    break;
                case BasicType.Int32:
                    ret = Int32.Parse(value);
                    break;
                case BasicType.UInt32:
                    ret = UInt32.Parse(value);
                    break;
                case BasicType.Int64:
                    ret = Int64.Parse(value);
                    break;
                case BasicType.UInt64:
                    ret = UInt64.Parse(value);
                    break;
                case BasicType.Single:
                    ret = Single.Parse(value);
                    break;
                case BasicType.Double:
                    ret = Double.Parse(value);
                    break;
                case BasicType.Decimal:
                    ret = Decimal.Parse(value);
                    break;
                case BasicType.DateTime:
                    ret = DateTime.Parse(value);
                    break;
                default:
                    ret = null;
                    break;
            }

            return (TYPE)ret;

        }

        protected virtual object Str2ObjTemplate<KEYTYPE, VALUETYPE>(string data)
        {

            if (data == null)
            {
                return null;
            }

            Dictionary<string, string> map = new Dictionary<string, string>();
            StringBuilder keySb = new StringBuilder();
            StringBuilder valueSb = new StringBuilder();

            bool isKey = false;
            bool isValue = false;

            StringBuilder buffer = new StringBuilder(data);
            buffer.Remove(0, 1);
            buffer.Length = buffer.Length - 1;

            for (int i = 0; i < buffer.Length; i++)
            {
                if (buffer[i] == '(')
                {
                    isKey = true;
                    keySb.Length = 0;
                }
                else if (buffer[i] == ')')
                {
                    isValue = false;
                    map.Add(keySb.ToString(), valueSb.ToString());
                }
                else if (buffer[i] == ',')
                {
                    isKey = false;
                    isValue = true;
                    valueSb.Length = 0;
                }
                else
                {
                    if (isKey)
                    {
                        keySb.Append(buffer[i]);
                    }
                    else
                    {
                        valueSb.Append(buffer[i]);
                    }

                }
            }

            Dictionary<KEYTYPE, VALUETYPE> result = new Dictionary<KEYTYPE, VALUETYPE>();

            string strKey = string.Empty;
            string strValue = string.Empty;
            foreach (KeyValuePair<string, string> item in map)
            {
                strKey = Util.UnescapeNode(item.Key);
                strValue = Util.UnescapeNode(item.Value);

                KEYTYPE key = Convert<KEYTYPE>(strKey);
                VALUETYPE value = Convert<VALUETYPE>(strValue);

                result.Add(key, value);

            }

            return result;

        }

