                }
                else if (typeof(KEYTYPE) == typeof(string))
                {
                    foreach (KeyValuePair<KEYTYPE, VALUETYPE> item in map)
                    {

                        strKey = Util.EscapeNode(item.Key as string);
                        strValue = Util.EscapeNode(item.Value.ToString());

