        private string Obj2StrTemplate<TYPE>(object value)
        {
            StringBuilder sb = new StringBuilder();
            IList<TYPE> list = value as IList<TYPE>;

            sb.Append("{");

            if (list.Count > 0)
            {
                if (typeof(TYPE) == typeof(string))
                {
                    string temp = null;
                    foreach (TYPE item in list)
                    {
                        temp = Util.EscapeNode(item.ToString());
                        sb.Append(temp + ",");
                    }
                }
                else
                {
                    foreach (TYPE item in list)
                    {
                        sb.Append(item.ToString() + ",");
                    }
                }

                sb.Remove(sb.Length - 1, 1);
            }

            sb.Append("}");

            return sb.ToString();

        }

        private string Obj2StrOfList(string type, object value)
        {
            string temp = null;

            BasicType basicType = (BasicType)Enum.Parse(typeof(BasicType), type);
            switch (basicType)
            {
                case BasicType.String:
                    temp = Obj2StrTemplate<String>(value);
                    break;
                case BasicType.Boolean:
                    temp = Obj2StrTemplate<Boolean>(value);
                    break;
                case BasicType.SByte:
                    temp = Obj2StrTemplate<SByte>(value);
                    break;
                case BasicType.Byte:
                    temp = Obj2StrTemplate<Byte>(value);
                    break;
                case BasicType.Char:
                    temp = Obj2StrTemplate<Char>(value);
                    break;
                case BasicType.Int16:
                    temp = Obj2StrTemplate<Int16>(value);
                    break;
                case BasicType.UInt16:
                    temp = Obj2StrTemplate<UInt16>(value);
                    break;
                case BasicType.Int32:
                    temp = Obj2StrTemplate<Int32>(value);
                    break;
                case BasicType.UInt32:
                    temp = Obj2StrTemplate<UInt32>(value);
                    break;
                case BasicType.Int64:
                    temp = Obj2StrTemplate<Int64>(value);
                    break;
                case BasicType.UInt64:
                    temp = Obj2StrTemplate<String>(value);
                    break;
                case BasicType.Single:
                    temp = Obj2StrTemplate<Single>(value);
                    break;
                case BasicType.Double:
                    temp = Obj2StrTemplate<Double>(value);
                    break;
                case BasicType.Decimal:
                    temp = Obj2StrTemplate<Decimal>(value);
                    break;
                case BasicType.DateTime:
                    temp = Obj2StrTemplate<DateTime>(value);
                    break;
                default:
                    temp = string.Empty;
                    break;
            }

            return temp;

