        protected override string Obj2Str(string type, object value)
        {
            if (value == null)
            {
                return null;
            }

            Match match = Regex.Match(type, "^(\\w+)\\[(\\w+)\\]$");

            if (match.Groups.Count != 3)
            {
                throw new Exception("type error!");
            }

            string extensionType = match.Groups[1].Value;
            //if (!IsExtensionType(extensionType))
            if (extensionType != ExtensionType.List.ToString())
            {
                throw new Exception("extension type error!");
            }

            string basicType = match.Groups[2].Value;
            if (!Util.IsBasicType(basicType))
            {
                throw new Exception("basic type error!");
            }

            return Obj2StrOfList(basicType, value);

        }

        protected override object Str2Obj(string type, string value)
        {
            if (value == null)
            {
                return null;
            }

            Match match = Regex.Match(type, "^(\\w+)\\[(\\w+)\\]$");

            if (match.Groups.Count != 3)
            {
                throw new Exception("type error!");
            }

            string extensionType = match.Groups[1].Value;
            //if (!IsExtensionType(extensionType))
            if (extensionType != ExtensionType.List.ToString())
            {
                throw new Exception("extension type error!");
            }

            string basicType = match.Groups[2].Value;
            if (!Util.IsBasicType(basicType))
            {
                throw new Exception("basic type error!");
            }

            return Str2ObjOfList(basicType, value);
        }

    }

