        protected override string Obj2Str(string type, object value)
        {
            if (value == null)
            {
                return null;
            }

            Match match = Regex.Match(type, "^(\\w+)\\[(\\w+),(\\w+)\\]$");

            if (match.Groups.Count != 4)
            {
                throw new Exception("type error!");
            }

            string extensionType = match.Groups[1].Value;
            //if (!IsExtensionType(extensionType))
            if (extensionType != ExtensionType.Map.ToString())
            {
                throw new Exception("extension type error!");
            }

            string keyType = match.Groups[2].Value;
            if (!Util.IsBasicType(keyType))
            {
                throw new Exception("key type error!");
            }

            string valueType = match.Groups[3].Value;
            if (!Util.IsBasicType(keyType))
            {
                throw new Exception("value type error!");
            }

            return Obj2StrOfMap(keyType, valueType, value);

        }

        protected override object Str2Obj(string type, string value)
        {
