        protected override object Str2ObjTemplate<KEYTYPE, VALUETYPE>(string data)
        {

            if (data == null)
            {
                return null;
            }

            List<Dictionary<string, string>> listMap = new List<Dictionary<string, string>>();
            Dictionary<string, string> map = null;

            StringBuilder keySb = new StringBuilder();
            StringBuilder valueSb = new StringBuilder();

            bool isKey = false;
            bool isValue = false;

            StringBuilder buffer = new StringBuilder(data);

            buffer.Remove(0, 1);
            buffer.Length = buffer.Length - 1;

            for (int i = 0; i < buffer.Length; i++)
            {
                if (buffer[i] == '(')
                {
                    isKey = true;
                    keySb.Length = 0;

                }
                else if (buffer[i] == ')')
                {

                    isValue = false;
                    map.Add(keySb.ToString(), valueSb.ToString());

                }
                else if (buffer[i] == ',')
                {

                    isKey = false;
                    isValue = true;
                    valueSb.Length = 0;

                }
                else if (buffer[i] == '{')
                {
                    map = new Dictionary<string, string>();
                }
                else if (buffer[i] == '}')
                {
                    listMap.Add(map);
                }
                else
                {
                    if (isKey)
                    {
                        keySb.Append(buffer[i]);
                    }
                    else
                    {
                        valueSb.Append(buffer[i]);
                    }
                }
            }


            List<Dictionary<KEYTYPE, VALUETYPE>> result = new List<Dictionary<KEYTYPE, VALUETYPE>>();

            string strKey = string.Empty;
            string strValue = string.Empty;

            foreach (Dictionary<string, string> item in listMap)
            {
                Dictionary<KEYTYPE, VALUETYPE> temp = new Dictionary<KEYTYPE, VALUETYPE>();
                foreach (KeyValuePair<string, string> entry in item)
                {
                    strKey = Util.UnescapeNode(entry.Key);
                    strValue = Util.UnescapeNode(entry.Value);

                    KEYTYPE key = Convert<KEYTYPE>(strKey);
                    VALUETYPE value = Convert<VALUETYPE>(strValue);

                    temp.Add(key, value);
                }

                result.Add(temp);
            }

            return result;

        }

        protected override string Obj2StrTemplate<KEYTYPE, VALUETYPE>(object value)
        {
            StringBuilder sb = new StringBuilder();
            List<Dictionary<KEYTYPE, VALUETYPE>> listMap = value as List<Dictionary<KEYTYPE, VALUETYPE>>;

            sb.Append("{");

            string strKey = null;
            string strValue = null;

            if (typeof(KEYTYPE) == typeof(string) && typeof(VALUETYPE) == typeof(string))
            {
                foreach (Dictionary<KEYTYPE, VALUETYPE> item in listMap)
                {
                    sb.Append("{");
                    foreach (KeyValuePair<KEYTYPE, VALUETYPE> entry in item)
                    {

                        strKey = Util.EscapeNode(entry.Key as string);
                        strValue = Util.EscapeNode(entry.Value as string);

                        sb.Append("(" + strKey + "," + strValue + ")");
                    }

                    sb.Append("}");
                }

            }
            else if (typeof(KEYTYPE) == typeof(string))
            {
                foreach (Dictionary<KEYTYPE, VALUETYPE> item in listMap)
                {
                    sb.Append("{");
                    foreach (KeyValuePair<KEYTYPE, VALUETYPE> entry in item)
                    {

                        strKey = Util.EscapeNode(entry.Key as string);
                        strValue = Util.EscapeNode(entry.Value.ToString());

                        sb.Append("(" + strKey + "," + strValue + ")");
                    }

                    sb.Append("}");
                }
            }
            else if (typeof(VALUETYPE) == typeof(string))
            {
                foreach (Dictionary<KEYTYPE, VALUETYPE> item in listMap)
                {
                    sb.Append("{");
                    foreach (KeyValuePair<KEYTYPE, VALUETYPE> entry in item)
                    {

                        strKey = Util.EscapeNode(entry.Key.ToString());
                        strValue = Util.EscapeNode(entry.Value as string);

                        sb.Append("(" + strKey + "," + strValue + ")");
                    }

                    sb.Append("}");
                }

            }
            else
            {
                foreach (Dictionary<KEYTYPE, VALUETYPE> item in listMap)
                {
                    sb.Append("{");
                    foreach (KeyValuePair<KEYTYPE, VALUETYPE> entry in item)
                    {

                        strKey = Util.EscapeNode(entry.Key.ToString());
                        strValue = Util.EscapeNode(entry.Value.ToString());

                        sb.Append("(" + strKey + "," + strValue + ")");
                    }

                    sb.Append("}");
                }
            }

            sb.Append("}");

            return sb.ToString();

        }

